drop table Book_Author;
drop table Author;
drop table Book;
 create table Book(id bigserial, isbn varchar(255), title text, publisher varchar(1000), primary key(id));
 create table Author (id bigserial, name varchar(1000), primary key(id));
 create table Book_Author (Book_id int8 references Book, authors_id int8 references Author) ;
